import React from 'react';
import '../App.css';
import api from '../api'

export class Cups extends React.Component {
    constructor(props){
        super(props);
        this.state = { products: []};
    }

    async componentDidMount(){
        await api.getAllProducts().then(products => {
            this.setState({
                products: products.data,
            })
        })
    }
    render() {
        return (
            <div>
                <h1>{this.state.products.forEach(product => {
                    <div>
                        {product}
                    </div>
                })}</h1>
            </div>
        )
    }
}
